import React,{useState,useEffect} from "react";
import axios from "axios"


function contacto() {
  const [data, setData] = useState([]);

  useEffect(() => {
    axios
      .get("http://localhost:3002/")
      .then((res) => {
        setData(res.data.contact);
      })
      .catch((error) => console.log(error));
  }, []);

  return (
    <div className="container">
      
      
      <h4>Contact me</h4>
      <p>LetÂ´s talk and get a coffee :)</p>
      <div className="row">
        <div className="col-3">
            <img src="images/contact/linkedin.png"/>
        </div>
        <div className="col-3">
        <img src="images/contact/github.png"/>
        </div>
        <div className="col-3">
        <img src="images/contact/email.png"/>
        </div>
        <div className="col-3">
        <img src="images/contact/whatsapp.png"/>
        </div>
      </div>
    </div>
  );
}
export default contacto;
